// src/LoginPage.jsx
import React, { useState } from "react";

const LoginPage = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("user");
  const [showPassword, setShowPassword] = useState(false);

  const handleTogglePassword = () => {
    setShowPassword(!showPassword);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (email === "" || password === "") {
      alert("Please fill in all fields.");
      return;
    }

    console.log("Login Info:");
    console.log("Email: " + email);
    console.log("Password: " + password);
    console.log("Role: " + role);
  };

  return (
    <div className="min-h-screen flex">
      <div className="relative w-3/4">
        <img
          src="./pubbackground.jpg"
          alt="Background Image"
          className="w-full h-full object-cover"
        />
        <div className="absolute top-0 left-0 w-full h-full bg-black bg-opacity-50 flex flex-col justify-center items-center">
          <h1 className="text-6xl text-teal-300">Logo</h1>
          <h2 className="text-2xl text-white mt-4 mb-4">Nama Website</h2>
          <p className="text-lg text-white text-center w-3/4">
            Jelajahi ribuan footage menarik di website kami!
          </p>
        </div>
      </div>

      <div className="w-1/2 bg-gray-800 flex flex-col justify-center items-center p-10">
        <h1 className="text-3xl text-white mb-4">Selamat Datang!</h1>
        <p className="text-lg text-white mb-8">
          Jelajahi ribuan footage menarik di website kami!
        </p>

        <form onSubmit={handleSubmit} className="w-full">
          <label htmlFor="email" className="block text-white mb-2">
            Email / username
          </label>
          <input
            type="text"
            id="email"
            name="email"
            placeholder="Masukkan email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            className="w-full p-3 mb-4 rounded bg-white text-black"
          />

          <label htmlFor="password" className="block text-white mb-2">
            Password
          </label>
          <div className="relative mb-4">
            <input
              type={showPassword ? "text" : "password"}
              id="password"
              name="password"
              placeholder="Masukkan password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              className="w-full p-3 rounded bg-white text-black pr-12"
            />
            <i
              className={`fas ${
                showPassword ? "fa-eye-slash" : "fa-eye"
              } absolute right-3 top-1/2 transform -translate-y-1/2 text-gray-500 cursor-pointer`}
              onClick={handleTogglePassword}
            ></i>
          </div>

          <label htmlFor="role" className="block text-white mb-2">
            Pilih Role
          </label>
          <select
            id="role"
            name="role"
            value={role}
            onChange={(e) => setRole(e.target.value)}
            className="w-full p-3 mb-4 rounded bg-gray-600 text-white"
          >
            <option value="user">User</option>
            <option value="admin">Admin</option>
            <option value="super-admin">Super Admin</option>
          </select>

          <a href="#" className="block text-right text-red-500 text-sm mb-4">
            Lupa Password?
          </a>

          <button
            type="button"
            className="w-full bg-gray-300 text-black font-bold py-3 rounded flex items-center justify-center mb-4"
          >
            <img
              src="google.png"
              alt="Google Logo"
              className="w-5 h-5 mr-2"
            />
            Masuk menggunakan Google
          </button>

          <button
            type="submit"
            className="w-full bg-blue-600 text-white font-bold py-3 rounded"
          >
            Masuk
          </button>
        </form>

        <p className="text-white mt-4 font-bold">
          Belum punya akun?{" "}
          <a href="#" className="text-red-500">
            Daftar
          </a>
        </p>
      </div>
    </div>
  );
};

export default LoginPage;
